import React from 'react';

const SearchInput = ({ onChange }) => {
  return (
    <div className="mb-3">
      <label className="form-label text-dark">Search products</label>
      <input
        type="text"
        placeholder="Recherchez votre article"
        className="form-control"
        onChange={onChange}
      />
    </div>
  )
}

export default SearchInput;
